import Slider from "react-slick";
import 'bootstrap/dist/css/bootstrap.css';
import React from "react";
import "./index.css";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import help from '../../assets/carousel/help.jpg';

export default function SimpleSlider() {
  var settings = {
    centerMode: true,
    centerPadding: '60px',
    slidesToShow: 3,
    responsive: [
      {
        breakpoint: 768,
        settings: {
          arrows: false,
          centerMode: true,
          centerPadding: '40px',
          slidesToShow: 3
        }
      },
      {
        breakpoint: 480,
        settings: {
          arrows: false,
          centerMode: true,
          centerPadding: '40px',
          slidesToShow: 1
        }
      }
    ]
  };
  return (
    <Slider {...settings}>
      <div>
        <img src={help} />
      </div>
      <div>
      <img src={help} />
      </div>
      <div>
      <img src={help} />
      </div>
      <div>
      <img src={help} />
      </div>
      <div>
      <img src={help} />
      </div>
      <div>
      <img src={help} />
      </div>
    </Slider>
  );
}
